  "id_str" : "296246533601505280",
  "text" : "[解] Aさんの最初の処理時間をP、慣れたあとをP'、他の人の処理が全部でOとする。最初はP/(P+O)=50%、P'/(P'+O)=25%だから、これからOを消去すると、P/P'=3になります。",
  "id" : 296246533601505280,
  "created_at" : "Tue Jan 29 13:20:52 +0000 2013",
