  "id_str" : "286838733892882432",
  "text" : "実家が工務店な幼馴染（女子）に誘われてなんとなく工業高校に入学した主人公（女子）が、部活で競技測量部に入って全国大会を目指す漫画とか。「あの三脚の置き方は鶴の型！」「ばかな、あれは初代測量競技王しか使えないのでは！」みたいな。そして決勝戦で立ちはだかる高専生。",
  "id" : 286838733892882432,
  "created_at" : "Thu Jan 03 14:17:38 +0000 2013",
